import React, { useState } from 'react';
import "./AddEnclosureForm.css"

const AddEnclosureForm = ({ onAddEnclosure }) => {
  const [enclosure_id, setID] = useState('');
  const [name, setName] = useState('');
  const [enclosure_type, setType] = useState('');
  const [build_date, setBuildDate] = useState('');
  const [address, setAddress] = useState('');
  const [cleaning_start, setCleaningStart] = useState('');
  const [cleaning_end, setCleaningEnd] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();

    // Backend logic for handling the submitted enclosure data can be implemented here

    // Logging the information for demonstration purposes
    console.log('Enclosure ID:', enclosure_id);
    console.log('Name:', name);
    console.log('Enclosure Type:', enclosure_type);
    console.log('Build Date:', build_date);
    console.log('Address:', address);
    console.log('Cleaning Start Time:', cleaning_start);
    console.log('Cleaning End Time:', cleaning_end);

    // Clearing the form fields after submission
    setID('');
    setName('');
    setType('');
    setBuildDate('');
    setAddress('');
    setCleaningStart('');
    setCleaningEnd('');
  };

  return (
    <form onSubmit={handleSubmit} className="enclosure-form">
      <div className="form-group">
        <label htmlFor="enclosureID">Enclosure ID:</label>
        <input
          type="number"
          id="enclosureID"
          value={enclosure_id}
          onChange={(e) => setID(e.target.value)}
          min="0" // Ensure non-negative numbers only
          required
        />
      </div>
      <div className="form-group">
        <label htmlFor="name">Name:</label>
        <input
          type="text"
          id="name"
          value={name}
          onChange={(e) => setName(e.target.value)}
          required
        />
      </div>
      <div className="form-group">
        <label htmlFor="enclosureType">Enclosure Type:</label>
        <input
          type="text"
          id="enclosureType"
          value={enclosure_type}
          onChange={(e) => setType(e.target.value)}
          required
        />
      </div>
      <div className="form-group">
        <label htmlFor="buildDate">Build Date:</label>
        <input
          type="date"
          id="buildDate"
          value={build_date}
          onChange={(e) => setBuildDate(e.target.value)}
          required
        />
      </div>
      <div className="form-group">
        <label htmlFor="address">Address:</label>
        <input
          type="text"
          id="address"
          value={address}
          onChange={(e) => setAddress(e.target.value)}
          required
        />
      </div>
      <div className="form-group">
        <label htmlFor="cleaningStart">Cleaning Start Time:</label>
        <input
          type="time"
          id="cleaningStart"
          value={cleaning_start}
          onChange={(e) => setCleaningStart(e.target.value)}
          required
        />
      </div>
      <div className="form-group">
        <label htmlFor="cleaningEnd">Cleaning End Time:</label>
        <input
          type="time"
          id="cleaningEnd"
          value={cleaning_end}
          onChange={(e) => setCleaningEnd(e.target.value)}
          required
        />
      </div>
      <div className="form-group">
        <button type="submit">Add Enclosure</button>
        <button type="button" onClick={handleReset}>Reset</button>
      </div>
    </form>
  );
};

export default AddEnclosureForm;
